import mathdef getIncomeTax(salary):     return(salary, salary)    salary = int(input("What is your salary?: "))personalAllownace = 11850percentage = 0if  salary >= personalAllownace and salary <= 34500:        percentage = 20    elif salary >= 34501 and salary <= 150000:        percentage = 40elif salary >= 150000:        percentage = 45else:          percentage = 0if percentage > 0:        salary = salary - personalAllownacetaxedAmount = int(round(salary * (percentage /100.00), 2))print(taxedAmount)